import { AbsDchooseApi } from "../abstract/AbsDchooseApi";

class DubboDchooseApi extends AbsDchooseApi {
    loadData(params,loading, callback) {
        return this.request({
            url: "/chooseService/loadData",
            method: "post",
            data: [params],
            loading: loading,
            baseURL: this.modulePath,
            headers: {
                "Content-Type": "application/json"
            }
        }).then(({ data }) => {
            let _data = data.data;
            callback(_data);
        });
    }
}

export { DubboDchooseApi };
